double f_l(double n)
{
	n+=amplitude_constant*sin(n*frequency_constant);
	return piano(n);
}
double f_r(double n)
{
	n-=amplitude_constant*sin(n*frequency_constant);
	return piano(n);
}
inline double attack_func(double n,double f)
{
	return pow(2,n/f*400);
}
inline double sustain_func(double n,double f)//sustain stage with slow decay
{
	return 1/(1+n/f*40);
}
inline double release_func(double n,double f,double start_vol)//release stage
{
	return start_vol*(tanh(n/f*500+3)+1)/2;
}
int main()
{
	double start_vol=0;
	short* pcm=new short[bufsize];
	waveform.wFormatTag=WAVE_FORMAT_PCM;
	waveform.nSamplesPerSec=44100;
	waveform.wBitsPerSample=16;
	waveform.nChannels=2;
	waveform.nAvgBytesPerSec=4*44100;
	waveform.nBlockAlign=4;
	waveform.cbSize=0;

	HANDLE wait=CreateEvent(NULL,0,0,"");

	header.lpData=(LPSTR)pcm;
	header.dwBufferLength=bufsize*2;
	header.dwBytesRecorded=0;
	header.dwUser=0;
	header.dwFlags=WAVE_ALLOWSYNC;
	header.dwLoops=1;
	printf("generating PCM...");
	for(int i=0;i<data_size;i++)
	{
		//attack
		for(int j=max(0,data[i*3-1]-1000);j<data[i*3+1];j++)
		{
			pcm[j*2]+=f_l(pi/44100*data[i*3]*(j-data[i*3+1]))*attack_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3])*2048;
			pcm[j*2+1]+=f_r(pi/44100*data[i*3]*(j-data[i*3+1]))*attack_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3])*2048;
		}
		//decay&sustain
		for(int j=data[i*3+1];j<data[i*3+2];j++)
		{
			pcm[j*2]+=f_l(pi/44100*data[i*3]*(j-data[i*3+1]))*sustain_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3])*2048;
			pcm[j*2+1]+=f_r(pi/44100*data[i*3]*(j-data[i*3+1]))*sustain_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3])*2048;
		}
		//release
		start_vol=sustain_func(pi/44100*data[i*3]*(data[i*3+2]-1-data[i*3+1]),data[i*3]);
		for(int j=min(data[i*3+2],bufsize>>1);j<min(data[i*3+2]+1000,bufsize>>1);j++)
		{
			pcm[j*2]+=f_l(pi/44100*data[i*3]*(j-data[i*3+1]))*release_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3],start_vol)*2048;
			pcm[j*2+1]+=f_r(pi/44100*data[i*3]*(j-data[i*3+1]))*release_func(pi/44100*data[i*3]*(j-data[i*3+1]),data[i*3],start_vol)*2048;
		}
	}
	printf("done");
	waveOutOpen(&out,WAVE_MAPPER,&waveform,(DWORD_PTR)&wait,0,CALLBACK_EVENT);
	waveOutPrepareHeader(out,&header,sizeof(WAVEHDR));
	waveOutWrite(out,&header,sizeof(WAVEHDR));
	Sleep(bufsize/88.200);
	waveOutClose(out);
	return 0;
}
